import { View,Image,Text } from 'react-native'
import React from 'react'

import stayTurned from '../assets/stay-turned.jpg'
import tw from 'tailwind-react-native-classnames'

const StayturnScreen = () => {
  return (
    <View style={tw`h-full w-full`}>
    <Text >敬请期待</Text>
      <Image 
      source={{uri:'https://upload.wikimedia.org/wikipedia/commons/thumb/5/58/Uber_logo_2018.svg/2560px-Uber_logo_2018.svg.png'}}
      />
    </View>
  )
}

export default StayturnScreen
